from untils.initBrowser import browsertype
from WebTestcase.POM.Menu import Menu
from WebTestcase.POM.UserManagementPage import UserManagementPage
import pytest
from log.log import logger
from untils.op_mysql import execute_web #数据库连接
import time
class TestUser(UserManagementPage,Menu):

    @pytest.fixture(scope="class")
    def test_into_userpage(self,login):
        '''进入用户管理页面'''
        if login:
            '''用例：登录之后，点击系统管理，点击用户管理，进入用户管理页面'''
            try:
                #进入用户管理页面
                self.into_user_page(login)
                # 定位iframe,并且进入iframe
                self.into_user_iframe(login)
                # 在用户管理页面，查找用户管理验证信息
                if self.assert_page_textcontent(login):
                    logger.info('进入用户管理页面成功')
                    yield login
                else:
                    logger.info('进入用户管理页面失败')
                    assert False,'进入用户管理页面失败'

            except Exception as  e:
                logger.info('进入用户管理页面失败')
                assert False, '进入用户管理页面失败'

    @pytest.fixture(scope="class")
    def test_random_click_node(self,test_into_userpage):
        '''点击树形节点，点击新增按钮'''
        if test_into_userpage:
            old_number = self.assert_table_number_text(test_into_userpage)  # 添加前用户数
            #随机点击树形中的某个节点
            node_text=self.random_click_node(test_into_userpage)
            #点击新增按钮
            self.click_user_add_button(test_into_userpage)
            #先判断是否有弹窗，然后判断弹窗内容是否正确，然后点击确定
            alert=self.assert_alert_persent(test_into_userpage)
            if alert:
                logger.info('确定新增弹窗成功')
                if self.assert_alert_text(alert.text,node_text):#验证弹窗框文本与节点文本是否相同
                    logger.info('弹窗框文本{0}与节点文本相同{1}'.format(alert.text,node_text))
                    alert.accept()#点击弹出框的确定按钮
                    yield test_into_userpage,node_text,old_number
                else:
                    logger.info('弹窗框文本{0}与节点文本{1}不相同'.format(alert.text,node_text))
                    yield False,node_text,old_number
                    assert False, '弹窗框文本{0}与节点文本{1}不相同'.format(alert.text,node_text)
            else:
                logger.info('确定新增弹窗失败')
                yield False,node_text,old_number
                assert False, '确定新增弹窗失败'

    @pytest.mark.skip()
    def test_add_user(self, test_random_click_node):
        '''新增用户'''
        if test_random_click_node[0]:
            old_number = test_random_click_node[2]#新增前的记录总数
            if self.assert_page_add_update_textcontent(test_random_click_node[0]):#检查是否进入用户添加页面
                logger.info('进入用户添加页面成功')
                if(self.assert_administrative_authority_text(test_random_click_node[0],test_random_click_node[1])):
                    logger.info('党组织管理权限与选择的树形节点一致')
                    self.user_add(test_random_click_node[0],'测试填写备注信息')#添加用户信息
                    alert = self.assert_alert_persent(test_random_click_node[0])#弹新增确认窗
                    if alert:
                        logger.info('新增确定弹窗成功')
                        if self.assert_alert_text(alert.text, test_random_click_node[1]):  # 验证弹窗框文本与节点文本是否相同
                            logger.info('弹窗框文本与节点文本相同')
                            alert.accept()  # 点击弹出框的确定按钮
                            logger.info('点击了新增提示框确定按钮')
                            time.sleep(2)
                            test_random_click_node[0].driver.switch_to.parent_frame()#切换上层iframe
                            if self.execut_js_div_alert(test_random_click_node[0]):#判断div框是否弹出
                                logger.info('div弹出框已弹出')
                                if self.assert_success_textcontent(test_random_click_node[0]):#判断是否为操作成功
                                    logger.info('新增操作成功')
                                    self.div_alert_button_click(test_random_click_node[0])  # 点击确定按钮
                                    logger.info('点击了div提示框确定按钮')
                                    self.into_user_iframe(test_random_click_node[0])#切换iframe
                                    logger.info('切换iframe')
                                    new_number = self.assert_table_number_text(test_random_click_node[0])  # 添加后用户数
                                    # 验证是否添加成功
                                    logger.info('用户增加前总数是{0}，用户增加后总数是{1}'.format(old_number, new_number))
                                    assert eval(new_number) == eval(old_number) + 1, '用户增加前总数是{0}，用户增加后总数是{1}'.format(
                                        old_number, new_number)
                                else:
                                    logger.info('新增操作失败')
                                    self.div_alert_button_click(test_random_click_node[0])  # 点击确定按钮
                                    self.into_user_iframe(test_random_click_node[0])#切换iframe
                                    self.cancel_button_click(test_random_click_node[0])#点击返回，返回列表页面
                                    assert False, '新增操作失败'
                            else:
                                logger.info('div弹出框不存在')
                                assert False,'div弹出框不存在'
                        else:
                            logger.info('弹窗框文本{0}与节点文本{1}不相同'.format(alert.text, test_random_click_node[1]))
                            assert False, '弹窗框文本{0}与节点文本{1}不相同'.format(alert.text, test_random_click_node[1])
                    else:
                        logger.info('新增确定弹窗失败')
                        assert False, '新增确定弹窗失败'
                else:
                    logger.info('党组织管理权限与选择的树形节点不一致')
                    assert False, '党组织管理权限与选择的树形节点不一致'
            else:
                logger.info('进入用户添加页面失败')
                assert False, '进入用户添加页面失败'
        else:
            logger.info('没有进入用户添加界面，不执行用户添加')

    @pytest.mark.skip()
    def test_update_user(self, test_into_userpage):
        '''修改用户'''
        if test_into_userpage:#进入用户管理界面才会有导航栏
            self.navigation_bar_user_click(test_into_userpage)#如果之前用例出错，点击导航栏中的用户管理，进入用户管理界面
            if self.assert_page_textcontent(test_into_userpage):#进入用户管理页面
                logger.info('进入用户管理页面成功')
                authority_text = self.get_table_user_administrative_authority_text(test_into_userpage)#获取列表中的党组织文本
                party_text = self.get_table_user_party_member_select_text(test_into_userpage).split('/')[0]#获取列表中党员文本
                role_text = self.get_table_user_role_select_text(test_into_userpage)#获取列表中角色文本获取
                print(authority_text,party_text,role_text)
                self.user_update_button_click(test_into_userpage)#点击编辑按钮
                if self.assert_page_add_update_textcontent(test_into_userpage):#是否进入编辑页面
                    logger.info('进入了编辑页面')
                    assert self.assert_update_administrative_authority_text(test_into_userpage,authority_text),'党组织管理权限回显是否正确'
                    assert self.assert_update_party_member_select_text(test_into_userpage,party_text),'党员回显是否正确'
                    assert self.assert_update_role_select_text(test_into_userpage,role_text),'角色回显是否正确'
                    self.submit_button_click(test_into_userpage)#点击提交
                    time.sleep(2)
                    test_into_userpage.driver.switch_to.parent_frame()  # 切换上层iframe
                    if self.execut_js_div_alert(test_into_userpage):  # 判断div框是否弹出
                        logger.info('div弹出框已弹出')
                        if self.assert_success_textcontent(test_into_userpage):  # 判断是否为操作成功
                            logger.info('修改操作成功')
                            self.div_alert_button_click(test_into_userpage)  # 点击确定按钮
                            logger.info('点击了div提示框确定按钮')
                            # test_random_click_node[0].driver.switch_to_default_content()#切换iframe
                            self.into_user_iframe(test_into_userpage)
                        else:
                            self.div_alert_button_click(test_into_userpage)  # 点击确定按钮
                            self.into_user_iframe(test_into_userpage)#切换iframe
                            self.cancel_button_click(test_into_userpage)#点击取消返回列表页面
                            logger.info('修改操作失败')
                            assert False, '修改操作失败'
                    else:
                        logger.info('div弹出框不存在')
                        assert False, 'div弹出框不存在'
                else:
                    logger.info('进入编辑页面失败')
                    assert False, '进入编辑页面失败'
            else:
                logger.info('进入用户管理页面失败')
                assert False, '进入用户管理页面失败'
        else:
            logger.info('没有进入用户添加界面，不执行用户编辑')

